import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import Alert from "react-bootstrap/Alert";
import Form from "react-bootstrap/Form";
import { Row } from "react-bootstrap";
import { Col } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import { add } from "../../api/api";
import { useState } from "react";

function RescueForm() {
  const [inputs, setinputs] = useState({});

  const navigate = useNavigate();
  function serverData() {
    // console.log("sever method test");
    add({
      ContactNo: "7755652598",
      Address: "Nit road silchar",
      CountPeople: "15",
    });
  }

  return (
    <>
      <div className="d-flex justify-content-center mb-5" >
        <div className="pt-5 pb-5 ">
          <Card style={{ width: "35rem"}} className="mb-5" >
            <Alert>
              <Alert.Heading className="d-flex justify-content-center">
                RESCUE FORM VICTIMS
              </Alert.Heading>
              <div className="d-flex justify-content-end pt-3">
                Victim Id:1212
              </div>
            </Alert>
            <Form className="mt-1 p-3">
              <Form.Group className="mb-3">
                <Form.Label>Contact No.:</Form.Label>
                <Form.Control
                  type="number"
                  value={inputs.ContactNo}
                  onChange={(e) => setinputs(e.target.value)}
                  placeholder="Enter Contact Number"
                />
              </Form.Group>

              <Form.Group className="mb-3">
                <Form.Label>Current Address:</Form.Label>
                <Form.Control
                  onChange={(e) => setinputs(e.target.value)}
                  type="text"
                  value={inputs.Address}
                  placeholder="Enter Your Address"
                />
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Count of People:</Form.Label>
                <Form.Control
                  onChange={(e) => setinputs(e.target.value)}
                  type="number"
                  value={inputs.CountPeople}
                  placeholder="Enter Count in Number"
                />
              </Form.Group>
              <div className="d-flex justify-content-center">
                <Button
                  onClick={(e) => {
                    navigate("/RequestSlip");
                    e.preventDefault();
                    serverData();
                  }}
                  variant="primary"
                  type="submit"
                >
                  Submit
                </Button>
              </div>
            </Form>
          </Card>
        </div>
      </div>
    </>
  );
}

export default RescueForm;
